an 11-yard catch on two targets.\",\"analysis\":\"Harris got the scoring started with a nine-yard rushing touchdown and finished with team highs in carries and rushing yards. He has been entrusted with 10-plus carries in five consecutive games, totaling 395 rushing yards on 73 carries (5.4 YPC) over that stretch. Harris has been a non-factor in the passing game, though, with just three catches all season. Sony Michel's (quad) impending return could cut into Harris' rushing workload in Week 12 against Arizona and beyond, though that drop could be offset somewhat by the expected absence of Rex Burkhead (knee), who was carted off in this one, per Darren Hartwell of Yahoo Sports.\",\"title\":\"Finds end zone as leading rusher\"},{\"timeEpochMilli\":\"1606054855000\",\"contents\":\"New England Patriots running back Damien Harris (ankle, chest) and cornerback Stephon Gilmore (knee) are both expected to play in Week 11 against the Texans. Both players were limited in practice all week, though Gilmore would be seeing his first game action in three weeks. Harris, on the other hand, played the past couple of weeks after being listed as questionable. The halfback ran all over the Baltimore run defense last week to the tune of 121 rushing yards and will be in the RB2 ...\",\"url\":\"https://www.rotoballer.com/player-news/damien-harris-stephon-gilmore-expected-to-suit-up/806699\",\"title\":\"Damien Harris, Stephon Gilmore Expected To Suit Up\"}],\"nameFirst\":\"Damien\",\"nameLast\":\"Harris\",\"hasLockedPremiumContent\":true,\"proTeam\":{\"abbreviation\":\"NE\",\"location\":\"New England\",\"name\":\"Patriots\"},\"positionEligibility\":[\"RB\"]},\"requestedGames\":[{\"game\":{\"id\":6300,\"away\":{\"abbreviation\":\"NE\",\"location\":\"New England\",\"name\":\"Patriots\"},\"home\":{\"abbreviation\":\"HOU\",\"location\":\"Houston\",\"name\":\"Texans\"},\"startTimeEpochMilli\":\"1606068000000\",\"status\":\"FINAL_SCORE\",\"awayScore\":20,\"homeScore\":27,\"period\":{\"ordinal\":1